    return (



        <div className="full-container">

                <img src={logohamster} alt="logo" className="img-style"/>


            <div className="container">
                <h2>Vote for the cutest hamster</h2>

            </div>

            <Link className="begin-btn" to="/battle">
                        BEGIN BATTLE
                    </Link>
        </div>

    );
}

export default Home;
